import "./card.sass"
const Card = ({url, price, address, priceText, expectedCost}) => {
    return(
        <div className="card">
            <div className="card__image">
            </div>
            <div className="card__price">
                {price}
            </div>
            <div className="card__price-text">
                {priceText} {expectedCost}
            </div>
            <div className="card__address">
                {address}
            </div>
        </div>
    )
}
export default Card;
